class Solution:
    def removeDuplicates(self, s: str, k: int) -> str:
        from itertools import groupby
        res = ""
        while True:
            tmp = ""
            for x, y in groupby(s):
                n = len(list(y))
                if n >= k:
                    tmp += x * (n % k)
                else:
                    tmp += x * n
            if tmp == res:
                break
            s = tmp
            res = tmp
        return res




a = Solution()
print(a.removeDuplicates(s="abcd", k=2))
print(a.removeDuplicates(s="deeedbbcccbdaa", k=3))
print(a.removeDuplicates(s="pbbcggttciiippooaais", k=2))
print(a.removeDuplicates(
    ""
    , 10000))
print(a.removeDuplicates("", 0))